import React from "react";

import './side-bar.css';
import Navbar from "./navbar";
import InfoBtn from "./info-btn";

const SideBar = () => {
    return (
        <div className='side-bar side-bar_hidden side-bar_active'>
            <Navbar />
            <InfoBtn />
        </div>
    )
};

export default SideBar;
